// MD5 库占位符文件
// 此文件为占位符，用于解决构建问题
// 在实际使用中应替换为真正的MD5库

(function(global) {
    'use strict';
    
    // MD5 占位符函数
    function md5(string) {
        // 简单的占位符实现
        return 'placeholder_md5_hash_' + string.length;
    }
    
    // 导出到全局
    if (typeof module !== 'undefined' && module.exports) {
        module.exports = md5;
    } else {
        global.md5 = md5;
    }
    
})(typeof window !== 'undefined' ? window : this);